import "./ComponentImport.css";
import { NavLink } from "react-router-dom";
import { useDispatch } from "react-redux";
import { useEffect } from "react";

export default function ComponentImport() {
  const dispatch = useDispatch();

  useEffect(() => {
    const handleSubmit = () => {
      dispatch({ type: "ON_GET_DATA" });
    };
    handleSubmit();
  }, []);
  return (
    <>
      <div className="form-import-container">
        <div className="form-import-content">
          <div className="form-import">
            <div className="title-content">
              <div className="title">
                <h2>
                  ĐIỂM CHUẨN CÁC TRƯỜNG ĐẠI HỌC 2021 VÀ GỢI Ý ĐĂNG KÝ NGUYỆN
                  VỌNG
                </h2>
                <p></p>
              </div>
              <div className="body-text">
                <div className="body-text-router">
                  <NavLink className="active-router effect-hover" to="/">
                    Điểm chuẩn các trường đại học
                  </NavLink>
                  <NavLink
                    className="effect-hover"
                    to="/FormSearch"
                    style={{ color: "#fff" }}
                  >
                    Tra cứu thông tin
                  </NavLink>
                </div>
                {/* <div className="body-text-input">
                <div className="input-info">
                  <span></span>
                  <input></input>
                </div>
              </div> */}
              </div>
            </div>
            <div className="body-content">
              {/* <input
                type="file"
                onChange={(e) => {
                  setSeclectFie(e.target.files[0]);
                }}
              ></input> */}
              <button className="sumit-form-import">Import</button>
            </div>
          </div>
        </div>
      </div>
      {/* <div className="content">
        <input
          type="file"
          onChange={(e) => {
            setSeclectFie(e.target.files[0]);
          }}
        ></input>
        <button onClick={fileSelect}>import</button>
      </div> */}
    </>
  );
}
